import Logo from "../logo/Logo";
import styled from 'styled-components';

const TitleText = styled.text`
font-size: 10em;
text-align: center;
color: white;
font-family: SpaceMonoRegular;
font-weight: 600;
`
const WelcomeText = styled.text`
font-size: 1.5em;
text-align: center;
color: white;
font-family: SpaceMonoBold;
font-weight: 100;
`

export default function Title() {
  return (
    <div>
      <Logo/>
      <WelcomeText>Welcome to the world of</WelcomeText>
      <TitleText>/PANACEA.</TitleText>
    </div>
  );
}
